//------ load CN_file for predicted contact number ------//
int Load_CN_File(string &cn_file,vector <int> &cn_number)
{
	//start
	ifstream fin;
	string buf,temp;
	//read
	fin.open(cn_file.c_str(), ios::in);
	if(fin.fail()!=0)
	{
		fprintf(stderr,"file %s not found!\n",cn_file.c_str());
		exit(-1);
	}
	//load
	cn_number.clear();
	int count=0;
	for(;;)
	{
		if(!getline(fin,buf,'\n'))break;
		istringstream www(buf);
		int cn;
		www>>cn;
		if(cn<0)cn=0;
		else if(cn>14)cn=14;
		cn_number.push_back(cn);
		count++;
	}
	//return
	return count;

}


//------ load predicted contact neibor --------//
//data format:
// position  contact_num   neibor_1  neibor_2 .... neibor_N
/*
5 0
6 0
7 0
8 0
9 4 29 30 28 27
10 0
11 7 27 26 25 29 28 30 38
....
*/
int Load_Pred_Contact_Neibor(string &cn_file,vector <vector <int> > &neibor_rec)
{
	//start
	ifstream fin;
	string buf,temp;
	//read
	fin.open(cn_file.c_str(), ios::in);
	if(fin.fail()!=0)
	{
		fprintf(stderr,"file %s not found!\n",cn_file.c_str());
		exit(-1);
	}
	//load
	neibor_rec.clear();
	int count=0;
	for(;;)
	{
		if(!getline(fin,buf,'\n'))break;
		istringstream www(buf);
		int cn;
		vector <int> tmp_rec;
		www>>temp>>cn;
		for(int i=0;i<cn;i++)
		{
			int pos;
			www>>pos;
			tmp_rec.push_back(pos);
		}
		neibor_rec.push_back(tmp_rec);
		count++;
	}
	//return
	return count;
}

//-------------- for prediction -------------//
//given one TGT file, output it's feature as well as the label (ACC)
void ACC_Feature_Make(string &tgt_file,vector <int> &cn_number,vector <string> &output,int Feat_Lab)
{
	//-- read tgt ---//
	string tgt_name,tgt_root;
	getBaseName(tgt_file,tgt_name,'/','.');
	getRootName(tgt_file,tgt_root,'/');
	SEQUENCE *s=new SEQUENCE(tgt_name,tgt_root);
/*
	//-- load cn_file --//
	vector <int> cn_number;
	int cn_len=Load_CN_File(cn_file,cn_number);
	//-- check --//
	if(cn_len!=s->length)
	{
		fprintf(stderr,"CN_len %d not equal to tgt_len %d \n",cn_len,s->length);
		exit(-1);
	}
*/
	//==== generate feature =====//
	output.clear();
	for(int k=0;k<s->length;k++)
	{
		//----- feature -----//
		vector <double> features;
		features.clear();

		//------------- profile related features --------------//
		if(Feat_Lab==7 || Feat_Lab==1 || Feat_Lab==5 || Feat_Lab==3)
		{
			//emission prob
			for(int i=0;i<20;i++)
			{
				double template_amino_Prob = 100.0*s->EmissionProb[k][i];
				features.push_back(template_amino_Prob);
			}
			//emission score
			for(int i=0;i<20;i++)
			{
				float template_amino_Score = 1.0*s->EmissionScore[k][i];
				features.push_back(template_amino_Score);
			}
		}

		//------------ structure related features -------------//
		if(Feat_Lab==7 || Feat_Lab==2 || Feat_Lab==6 || Feat_Lab==3)
		{
			//ss2 prob
			for(int i=0;i<3;i++)features.push_back(s->SS2[k][i]);
			//ss8 prob
			for(int i=0;i<8;i++)features.push_back(s->SS8[k][i]);
			//input contact number feature
			features.push_back(cn_number[k]);
		}

		//------------ amino_acid related features ------------//
		if(Feat_Lab==7 || Feat_Lab==4 || Feat_Lab==5 || Feat_Lab==6)
		{
			//zy ami model
			int pos=AA4SUB[s->sequence[k]-'A']-1;
			vector <int> aaind(20,0);
			if(pos<0 || pos>=20)
			{
				for(int i=0;i<58;i++)
				{
					features.push_back(0);
				}
				for(int i=0;i<20;i++)
				{
					features.push_back(aaind[i]);
				}
			}
			else
			{
				for(int i=0;i<58;i++)
				{
					double zy_model=ACC_ZY_AmiModel[pos][i];
					features.push_back(zy_model);
				}
				aaind[pos]=1;
				for(int i=0;i<20;i++)
				{
					features.push_back(aaind[i]);
				}
			}
		}

		//------ output ------//
		int featdim=(int)features.size();
		stringstream oss;
		for(int i=0;i<featdim;i++)
		{
			int wsiii=(int)features[i];
			if(wsiii!=features[i])oss << features[i] << " ";
			else oss << wsiii << " ";
		}
		string wsbuf=oss.str();
		output.push_back(wsbuf);
	}
	
	//delete
	delete s;
}

//========== acc_predict ===========//__120820__//
//only single chain
void CNF_Model_Predict(vector <string> &feat,vector <vector <double> > &output,
	double *weight,int states,int windows,int feat_num,int gates)
{
	//--- load model ---//
	bCNF_Model cnfModel;
	cnfModel.cnf_model_load(weight,states,windows,feat_num,gates);
	cnfModel.LoadData_IV(feat);
	//-- calc --//
	cnfModel.testData[0]->makeFeatures();
	cnfModel.testData[0]->ComputeGates();
	cnfModel.testData[0]->ComputeVi();
	cnfModel.testData[0]->MAP(output);
	//delete
	delete cnfModel.testData[0];
}
int Return_Label(vector <double> &in,double &maxval)
{
	int i;
	int size=(int)in.size();
	int label=0;
	double wsmax=0;
	for(i=0;i<size;i++)
	{
		if(in[i]>wsmax)
		{
			wsmax=in[i];
			label=i;
		}
	}
	maxval=wsmax;
	return label;
}

